var maximumLength = function(nums) {
    var test = new Map();
    nums.sort((a, b) => a - b);
    var set = new Set(nums);
    var arrMaxLen = 0;
    var len = 1;

    for (var i = 0; i < nums.length; i++) {
        test.set(nums[i], (test.get(nums[i]) || 0) + 1);
    }

    for (var value of set) {
        if (test.has(Math.pow(value, 2)) && test.get(value) > 1) {

            var num = value;
            while(test.get(num)) {
                test.set(num, test.get(num) - 1);
                arrMaxLen++;
                num = Math.pow(num, 2);
            }

            num = Math.pow(num, 0.25);
            while (test.get(num)) {
                test.set(num, test.get(num) - 1);
                arrMaxLen++;
                num = Math.pow(num, 0.5);
            }
        }


        len = Math.max(arrMaxLen, len);
        arrMaxLen = [];
    }
    
    return len % 2 == 0 ? len - 1 : len;
};


